import React, { useState } from 'react';

function DeploymentForm({ onDeploy }) {
    const [deploymentData, setDeploymentData] = useState('');

    const handleSubmit = (e) => {
        e.preventDefault();
        const formattedData = deploymentData.split(',').map(item => item.trim()); // Example: parse deployment data
        onDeploy(formattedData);
    };

    return (
        <form onSubmit={handleSubmit}>
            <label>
                Deployment Data:<input
                    type="text"
                    value={deploymentData}
                    onChange={(e) => setDeploymentData(e.target.value)}
                    placeholder="Enter character names separated by commas"
                />
            </label>
            <button type="submit">Deploy</button>
        </form>
    );
}

export default DeploymentForm;
